"Когато функцията за Wi-Fi е активирана, часовникът ви автоматично ще включва или изключва Wi-Fi, за да запазва батерията. Това ще се случва, когато: 

• приложение изисква Wi-Fi; 
• режимът за запазване на батерията е включен; 
• часовникът се зарежда; 
• часовникът се актуализира; 
• часовникът е далеч от телефона; 
• часовникът не може да се свърже с Wi-Fi; 
• възникнат някои други случаи."
